export default {
  container: {
    backgroundColor: "white",
    flex: 1,
  },

  bgContainer: {
    borderBottomWidth: 0.5,
    backgroundColor: "#03255F",
  },

  userContainer: {
    alignItems: "center",
    justifyContent: "center",
    marginTop: 20,
    backgroundColor: "#03255F",
    marginBottom: 20,
  },

  userImagen: {
    width: 260,
    height: 70,
  },

  userNombre: {
    marginVertical: 10,
  },

  userTitulo: {
    textAlign: "center",
    fontWeight: "bold",
    fontSize: 16,
  },

  userSubTitulo: {
    textAlign: "center",
    fontSize: 11,
    color: "#a537fd",
    paddingVertical: 5,
  },
  menuContainer: {
    flexDirection: "row",
    justifyContent: "center",
    marginLeft: 15,
    marginVertical: 12,
  },

  iconoContainer: {
    flex: 1.5,
    justifyContent: "center",
    marginLeft: 10,
  },

  tituloContainer: {
    flex: 8.5,
    justifyContent: "center",
    marginLeft: 20,
  },

  tituloTxt: {
    fontSize: 10,
    color: "#03255F",
    fontWeight: "bold",
  },
  difuminado: {
    flex: 1,
    backgroundColor: "rgba(0, 0, 0, 0.5)",
  },
  fondoImagen: {
    position: "absolute",
    left: 0,
    top: 0,
    right: 0,
    bottom: 0,
  },
};
